import "./App.css";
import Main from "./main/index";
import TransitionalPlanning from "./transitional-planning";
import AlternativePaths from "./alternative-paths";
import Community from "./community";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route
            path="transitionalplanning"
            exact
            component={TransitionalPlanning}
          />
          <Route exact path="/" component={Main} />
          <Route path="alternativepaths" exact component={Community} />
          <Route path="community" exact component={AlternativePaths} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
